;; @@
(defquery gaussian-mixture []
  (let [mode (sample (discrete [0.7 0.3]))
        theta (sample (normal 0 100))]
    (observe (case mode
               0 (normal 20 10)
               1 (normal -20 10))
             theta)
    theta))
    
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mcmc-sampling/gaussian-mixture</span>","value":"#'mcmc-sampling/gaussian-mixture"}
